CREATE TABLE `log_Perform` (
   `id` mediumint(1) unsigned zerofill NOT NULL AUTO_INCREMENT,
   `batch_no` char(64) NOT NULL,
   `table_dispatch` char(64) NOT NULL,
   `table_case` char(64) NOT NULL,
   `case_Rowid` char(16) DEFAULT NULL,
   `script_name` char(64) NOT NULL,
   `time_Response` int(16) DEFAULT NULL,
   `Time_execute` datetime DEFAULT NULL,
   `execute_result` varchar(8) DEFAULT '""',
   `execute_errormsg` text,
   PRIMARY KEY (`id`)
 ) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8
 
